    def _abu_molfrac_raw(self, x):
        """
        raw Galactic Chemical History Model based on \\xi (here variable x)
        """

        # define the functions for scaling the solar decomposition

        f_matrix = np.ndarray((17))
        f_matrix[0] = x**1.227
        f_matrix[1] = x**1.509
        f_matrix[2] =  1
        # assure that the min contribution from strong s-process to be
        # zero (rather than negative)
        f_matrix[3] = max(0, -2.e-11 * (1 - (np.tanh(200 * x - 0.23) / np.tanh(200 - 0.23))))
        f_matrix[4] = x**1.230
        f_matrix[5] = x**0.938
        f_matrix[6] = x**0.938
        f_matrix[7] = x**((1.509 + 0.938) * 0.5)
        f_matrix[8] = x * ((np.tanh(5.024 * x - 2.722)) + np.tanh(2.722)) / (np.tanh(5.024-2.722) + np.tanh(2.722))
        f_matrix[9] = (np.log10(x) + 2.4983277)
        f_matrix[10]= 1
        f_matrix[11]= x**1.509
        f_matrix[12]= x**0.938
        f_matrix[13]= 1
        f_matrix[14]= x**0.938
        f_matrix[15]= 1
        f_matrix[16]= x

        # multiply the two matricies (sort of).

        # This gives the abundances at the user defined value of \xi

        vec = list(range(0,9)) + list(range(11,17))
        abu = np.dot(f_matrix[vec], self.x_matrix[vec,:])

        xvec = slice(9,76)
        v = np.log10(self.x_matrix[10, xvec])
        sne = 10.**(f_matrix[ 9] * self.x_matrix[ 9, xvec] +
                    f_matrix[10] * v)
        abu[xvec] += sne

        return abu


    def __init__(self, z, **kw):
        """
        Generate abundances set using z = Z/Z_sun, the scale relative
        to solar.
        """

        silent = kw.setdefault('silent', False)
        self.setup_logger(silent = silent)

        check = kw.get('check', False)
        if check:
            assert x_matrix.shape[1] == len(self.ions)

        super().__init__(z, **kw)

        if z > 0:
            zz = f"{z:g} solar"
        else:
            zz = f"{-z:g} absolute metallicity"

        xyz = "X = {:8G}, Y = {:8G}, Z = {:8G}".format(*self.XYZ())

        self.comment = (
            "Version {:6s} - {:s} UTC".format(
                self.version,
                time.asctime(time.gmtime())),
            f"GCH abundances: {zz:s}",
            xyz)
        self.logger.info(xyz)
        self.close_logger()
